def solution(stdin: str) -> str:
    inp = list(map(lambda x: x.strip(), stdin.strip().split('\n')))
    possible_prefixes, possible_suffixes = [], []
    for index, prefix in enumerate(inp[::2]):
        possible_prefixes.append(prefix)
        possible_suffixes.append(prefix[::-1])
    result = set()
    for index, suffix in enumerate(inp[1::2]):
        for prefix in possible_prefixes:
            if prefix == suffix:
                result.add(prefix)
        for suffix in possible_suffixes:
            if suffix == prefix[::-1]:
                result.add(suffix)
    return ''.join(sorted(result)) if len(result) else 'SP'

