def solution(stdin: str) -> str:
    # using the concept of binary search to find the right answer
    n, k = list(map(int, stdin.split(" ")))
    n += 1

    def binSearch(left, right, idx):
        # binary search between left and right values to find the correct answers
        if left > right:
            return 0
        mid = (left + right) // 2
        # right-rotation
        rotation = mid
        for i in range(idx, k):
            if rotation - i < 0:
                return 0
            rotation -= i
        return binSearch(left, mid - 1, rotation) + binSearch(mid, right, idx + 1)

    return str(binSearch(0, n - 1, 0))

