def solution(stdin: str) -> str:
    import math
    import heapq
    import sys

    N, K = list(map(int, stdin.split()))

    # 1. Write down all integers between 2 and N, inclusive
    l = []
    for num in range(2, N + 1):
        if num in l:
            continue
        else:
            l.append(num)

    # 2. Find the smallest number not already crossed out and call it P
    P = N
    while P in l:
        P -= 1

    # 3. Cross out P and all its multiples that aren't already crossed out
    l = list(l)
    while P in l:
        l.remove(P)
        for i in range(2, int(math.sqrt(P)) + 1):
            if P % i == 0:
                l.remove(P)
                break

    # 4. If not all numbers have been crossed out, go to step 2.
    return l[K - 1]

