    """
    Takes a string as input and returns the minimum number of moves
    required to get from the starting position to the goal position,
    if possible.
    """
    W, H = map(int, stdin.split())
    maze = stdin.splitlines()
    print(maze)

    def get_neighbors(x, y):
        """
        Returns all valid neighbors of a given node.
        """
        neighbors = []
        if x > 0:
            neighbors.append((x - 1, y))
        if x < W - 1:
            neighbors.append((x + 1, y))
        if y > 0:
            neighbors.append((x, y - 1))
        if y < H - 1:
            neighbors.append((x, y + 1))
        return neighbors

    def next_step(x, y):
        """
        Returns the next position in the path if it exists.
        Otherwise it returns a None.
        """
        neighbors = get_neighbors(x, y)
        for neighbor in neighbors:
            if maze[neighbor[1]][neighbor[0]] == '.':
                return neighbor
        return None

    def is_trapped(x, y):
        """
        Checks if a point is trapped.
        """
        neighbors = get_neighbors(x, y)
        for neighbor in neighbors:
            if maze[neighbor[1]][neighbor[0]] == 'T':
                return True
        return False

    def is_wall(x, y):
        """
        Checks if a point is a wall.
        """
        if maze[y][x] == '#':
            return True
        else:
            return False

    def num_traps():
        """
        Counts the number of trapped points.
        """
        count = 0
        for y in range(H):
            for x in range(W):
                if is_trapped(x, y):
                    count += 1
        return count

    def get_path(current_x, current_y):
        """
        Returns the path from the starting position to the goal position.
        """
        path = []
        x, y = current_x, current_y
        while not is_wall(x, y) and not is_trapped(x, y):
            x, y = next_step(x, y)
            path.append((x, y))
        return path

    def num_golds():
        """
        Counts the number of golds present.
        """
        count = 0
        for y in range(H):
            for x in range(W):
                if maze[y][x] == 'G':
                    count += 1
        return count

    return str(num_golds() - num_traps())

